import React from 'react'
import HeaderP from './HeaderP'
function Header(){
    return (
        <div>
            <h1 style={h1Style}>Lorem Ipsum</h1>
            <HeaderP />
        </div>
    )
}

const h1Style = {
    fontFamily: 'Times-New-Roman',
    fontSize: '4em',
    display: 'flex',
    backgroundColor: '#BCD3F2',
    justifyContent: 'center'
}


export default Header
